> Otherwise, I'm unsure what the right location or way to express this in the documentation without it feeling out of place or too nit picky of a detail for the user looking for something else.

I would we document the behavior in [cargo-package(1)](https://doc.rust-lang.org/cargo/commands/cargo-package.html), regardless the warnings are reported at runtime or not. It already has quite an amount of how it processes the `.crate` file.

